import React from 'react'
import styled from 'styled-components'
import logo from '../images/logo.jpg'
import HomeIcon from '@mui/icons-material/Home';
import ExploreOutlinedIcon from "@mui/icons-material/ExploreOutlined";
import SubscriptionsOutlinedIcon from "@mui/icons-material/SubscriptionsOutlined";
import VideoLibraryOutlinedIcon from "@mui/icons-material/VideoLibraryOutlined";
import HistoryOutlinedIcon from "@mui/icons-material/HistoryOutlined";
import LibraryMusicOutlinedIcon from "@mui/icons-material/LibraryMusicOutlined";
import SportsEsportsOutlinedIcon from "@mui/icons-material/SportsEsportsOutlined";
import SportsBasketballOutlinedIcon from "@mui/icons-material/SportsBasketballOutlined";
import MovieOutlinedIcon from "@mui/icons-material/MovieOutlined";
import ArticleOutlinedIcon from "@mui/icons-material/ArticleOutlined";
import LiveTvOutlinedIcon from "@mui/icons-material/LiveTvOutlined";
import AccountCircleOutlinedIcon from "@mui/icons-material/AccountCircleOutlined";
import SettingsOutlinedIcon from "@mui/icons-material/SettingsOutlined";
import FlagOutlinedIcon from "@mui/icons-material/FlagOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutlineOutlined";
import SettingsBrightnessOutlinedIcon from "@mui/icons-material/SettingsBrightnessOutlined";
const Container =styled.div`
  flex:1;
  height: 100vh;
  background-color: #232121;
  color: white;
  overflow-y: auto;
`
const Wrapper =styled.div`
  padding: 18px 26px;
`
const Logo =styled.div`
  display: flex;
  align-items: center;
  gap: 5px;
  font-weight: bold;
  font-family: Verdana, Geneva, Tahoma, sans-serif;
  margin-bottom:25px;
  position: fixed;
`

const OrangeText = styled.span`
  color: #dc5b06;
`;
const Img=styled.img`
height: 40px;
width: 70px;
border-radius: 7px;
`
const Item=styled.div`
  display: flex;
  align-items: center;
  gap: 17px;
  cursor: pointer;
  font-family:'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  font-size: 14px; 
  padding: 9px 0px;
  posi

`
const icon={fontSize:'20px'}
export const Menu = () => {
  return (
    <Container>
      <Wrapper>
        <Logo>
          <Img src={logo}/>
          <div>
          <OrangeText>AK</OrangeText>ube
          </div>
        </Logo>
        <Item>
          <HomeIcon style={icon}/>
          Home
        </Item>
        <Item>
          <ExploreOutlinedIcon style={icon} />
          Explore
        </Item>
        <Item>
          <SubscriptionsOutlinedIcon style={icon}  />
          Subscriptions
        </Item>
        <Item>
          <VideoLibraryOutlinedIcon style={icon} />
          Library
        </Item>
        <Item>
          <HistoryOutlinedIcon style={icon} />
          History
        </Item>
        <Item>
          <LibraryMusicOutlinedIcon style={icon} />
          Music
        </Item>
        <Item>
          <SportsBasketballOutlinedIcon style={icon} />
          Sports
        </Item>
        <Item>
          <SportsEsportsOutlinedIcon style={icon}/>
          Gaming
        </Item>
        <Item>
          <MovieOutlinedIcon style={icon}/>
          Movies
        </Item>
        <Item>
          <ArticleOutlinedIcon style={icon}/>
          News
        </Item>
        <Item>
          <LiveTvOutlinedIcon style={icon}/>
          Live
        </Item>
        <Item>
          <SettingsOutlinedIcon style={icon}/>
          Settings
        </Item>
        <Item>
          <FlagOutlinedIcon style={icon}/>
          Report
        </Item>
        <Item>
          <HelpOutlineOutlinedIcon style={icon}/>
          Help
        </Item>
      </Wrapper>
    </Container>
  )
}
